  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Medicine Lake
  Migratory Waterfowl Refuge outlines Refuge accomplishments from February through
  April of 1939. The report begins by summarizing the weather conditions during this
  period. Wildlife- including migratory birds, upland game birds, furbearers, predators,
  and rodents- is also covered. The Refuge development and maintenance section discusses
  physical developments, plantings, and collections and receipts. The public relations
  section of the report describes recreational uses. Items of interest are attached.\",\n\t\"license_title\":
